import resumePDF from '../assets/resume.pdf';

export default function Resume() {
    return (
        <section className="resume">
            <h2>My Resume</h2>
            <iframe
                src={resumePDF}
                width="100%"
                height="800px"
                title="Resume PDF"
                frameBorder="0"
            ></iframe>
        </section>
    );
}
